import React from "react";
import styled from "styled-components";

const Home = () => {
  return (
    <>
      <div>
        <h1>수도권 미세먼지</h1>
        <div>
          <button>실시간 현황확인</button>
        </div>
        <div>
          <div>
            <ul>
              <li>측정시간 : </li>
              <li>서울 : </li>
              <li>인천 : </li>
              <li>경기 : </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

const Wrap = styled.div`
  width: 100vw;
  height: 100vh;
  margin: auto;
`;

export default Home;
